body {
    font-family: 'Roboto', Arial, sans-serif;
}

/* Chart-specific styles */
.chart,
.chart-container,
canvas,
svg,
.chartjs-render-monitor {

}

body {
    margin: 0;
    padding: 16px;
}

.tabBar {
    display: flex;
    overflow: hidden;
    box-shadow: 0 2px 8px rgba(0, 0, 0, 0.07);
    min-height: 32px;
    margin-bottom: 8px;
    margin-top: 8px;
    margin-left: 8px;
    margin-right: 8px;
}

.tabs {
    border-radius: 8px;
    padding: 8px 20px;
    cursor: pointer;
    background: none;
    border: none;
    outline: none;
    font-size: 1rem;
    color: #555;
    transition: background 0.3s, color 0.3s;
    text-align: center;
    margin: 12px;
}

.tabs:not(.selectedTab):hover {
    background: #e0e0e0;
    color: #222;
}

.selectedTab {
    background: #1976d2;
    color: #fff;
    font-weight: bold;
    box-shadow: 0 2px 8px rgba(25, 118, 210, 0.15);
    transition: background 0.3s, color 0.3s;
}

#content {
    display: flex;
    flex-wrap: wrap;
    padding: 0px;
    gap: 8px;
    justify-content: space-between;
}

.parentHolder {
    display: flex;
    margin: 2px;
    border: 1px solid #d3d3d3;
}

.parentHolder::after {
    border: 2px solid red;
    /* Change color and width as needed */
    pointer-events: none;
    z-index: 2;
}

.tabContent {
    opacity: 1;
    transition: opacity 0.3s,
}

      const _sort = (order, data, ...keys) => {
    return data.sort((a, b) => {
        let directive = 0;

        keys.some(key => {
            directive = typeof a[key] === 'number' ? a[key] - b[key] : a[key].localeCompare(b[key])
            if (order === 'dsc') directive = directive * -1
            if (directive !== 0) return true;
        })

        return directive;
    })
}
      const createElement = (name, type, visualisationOptions, eventData, { trellis, trellisName = "" }) => {
